import React from "react";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import Card from "@material-ui/core/Card";
import GridItem from "components/Grid/GridItem.jsx";
import GridContainer from "components/Grid/GridContainer.jsx";
import CustomInput from "components/CustomInput/CustomInput.jsx";
import CardHeader from "components/Card/CardHeader.jsx";
import CardBody from "components/Card/CardBody.jsx";
import CardFooter from "components/Card/CardFooter.jsx";
import { Checkbox } from "@material-ui/core";
import Grid from "@material-ui/core/Grid";
import Breadcrumbs from "@material-ui/lab/Breadcrumbs";
import Typography from "@material-ui/core/Typography";
import Link from "@material-ui/core/Link";

const styles = {
  cardTitleWhite: {
    color: "#FFFFFF",
    marginTop: "0px",
    minHeight: "auto",
    fontSize: "28px",
    fontWeight: "300",
    fontFamily: "'Roboto', 'Helvetica', 'Arial', sans-serif",
    marginBottom: "3px",
    textDecoration: "none"
  },
  cardTitleHPSBlue: {
    backgroundColor: "#1C80B5"
  },
  card: {
    maxWidth: 800
  }
};
class BankDetails extends React.Component {
  constructor(props) {
    super(props);
    //     this.state = {
    //       one: "",
    //       two: "",
    //       three: "",
    //       four: "",
    //       five: "",
    //       six: "",
    //       seven: "",
    //       eight: "",
    //       nine: "",
    //       ten: "",
    //       eleven: ""
    //     };
    //   }
    this.state = {
      CarrierName: null,
      CarrierCode: null,
      CarrierLogo: null,
      CarrierDesc: null,
      CarrierContactNumber: null,
      CarrierWebsite: null
    };
  }
  handleSubmit = e => {
    e.preventDefault();
    this.props.history.push(`/admin/CarrierConfiguration2`);
  };

  // handleChange = e => {
  //   const { name, value } = e.target;
  //   switch (name) {
  //     case "CarrierName":
  //       break;
  //     case "CarrierCode":
  //       break;
  //     case "CarrierLogo":
  //       break;
  //     case "CarrierDesc":
  //       break;
  //     case "CarrierContactNumber":
  //       break;
  //     case "CarrierWebsite":
  //       break;
  //     default:
  //       break;
  //   }
  // };
  onFileLoad = (e, file) => console.log(e.target.result, file.name);
  render() {
    const { classes } = this.props;

    return (
      <form onSubmit={this.handleSubmit}>
        <Grid
          container
          alignItems="flex-start"
          justify="flex-end"
          direction="row"
        >
          {/* <Breadcrumbs
            separator={<NavigateNextIcon fontSize="small" />}
            arial-label="Breadcrumb"
          >
            <Link color="inherit" href="/admin/CarrierConfiguration">
                Page1
              </Link>
          </Breadcrumbs> */}
        </Grid>
        <GridContainer direction="row" justify="center" alignItems="center">
          <Card className={classes.card}>
            <CardHeader className={classes.cardTitleHPSBlue}>
              <h4 className={classes.cardTitleWhite}>Configure new Carrier</h4>
            </CardHeader>
            <CardBody name="card">
              <GridContainer>
                <GridItem xs={12} sm={12} md={6}>
                  <CustomInput
                    labelText="Carrier Name"
                    id="CarrierName"
                    name="CarrierName"
                    formControlProps={{
                      fullWidth: true,
                      variant: "filled",
                      required: true,
                      error: true
                    }}
                  />
                </GridItem>
                <GridItem xs={12} sm={12} md={6}>
                  <CustomInput
                    labelText="Carrier Code"
                    id="CarrierCode"
                    formControlProps={{
                      fullWidth: true,
                      required: true,
                      error: true
                    }}
                  />
                </GridItem>
              </GridContainer>
              <GridContainer
                direction="row"
                justify="center"
                alignItems="center"
              >
                <GridItem xs={12} sm={12} md={6}>
                  <CustomInput
                    labelText="Carrier Website"
                    id="CarrierWebsite"
                    formControlProps={{
                      fullWidth: true,
                      required: true,
                      error: true
                    }}
                  />
                </GridItem>
                <GridItem xs={12} sm={12} md={6}>
                  <CustomInput
                    labelText="Carrier Desc"
                    id="CarrierDesc"
                    formControlProps={{
                      fullWidth: true,
                      required: true,
                      error: true
                    }}
                  />
                </GridItem>
              </GridContainer>
              <GridContainer
                direction="row"
                justify="center"
                alignItems="center"
              >
                <GridItem xs={12} sm={12} md={6}>
                  <CustomInput
                    labelText="Carrier Contact Number"
                    id="CarrierContactNumber"
                    formControlProps={{
                      fullWidth: true,
                      required: true,
                      error: true
                    }}
                  />
                </GridItem>
                <GridItem xs={12} sm={12} md={2}>
                  <Typography color="textPrimary">Carrier Logo</Typography>
                </GridItem>
                <GridItem xs={12} sm={12} md={4}>
                  <input
                    accept="image/*"
                    className={classes.input}
                    id="text-button-file"
                    multiple
                    type="file"
                  />
                </GridItem>
              </GridContainer>
              <GridContainer direction="column" alignItems="left">
                <GridItem xs={12} sm={12} md={6}>
                  <Checkbox label="checkBox" />
                  Setup Carrier Default Configuration
                </GridItem>
              </GridContainer>
            </CardBody>
            <CardFooter>
              <Grid
                container
                alignItems="flex-start"
                justify="flex-end"
                direction="row"
              >
                <Button type="submit" className={classes.cardTitleHPSBlue}>
                  Next
                </Button>
              </Grid>
            </CardFooter>
          </Card>
        </GridContainer>
      </form>
    );
  }
}

export default withStyles(styles)(BankDetails);
